insert into `GENMANUALCODE`( GENMANUALCODEid 
,ParentStructRowID,ChangeStamp,Code,the_Alias,Name) values( G2B('{7F0F660C-D5F6-44FE-AFF3-66FA89034FF5}'),G2B('{C10CAD25-95ED-4518-9177-E29824F01E47}'),str_to_date('2012-01-20 14:40:23','%Y-%m-%d %H:%i:%s'),'create or replace procedure Login
  
(aTHE_SESSION out  CHAR/* Идентификатор новой сессии */  
  
,aPWD VARCHAR2/* Пароль */  
  
,aUSR VARCHAR2/* Имя пользователя */  
  
)  
 as   
  
aID char(38);   
aUSERSID char(38);   
asysid char(38);   
SysLogid char(38); 
existsCnt integer;   
begin   
asysid := null;   
select instanceid into asysid from instance where objtype = ''MTZSYSTEM'';   
athe_session:=null  ;   
if aPWD is null   
then   
 select count(*) into existsCnt from users where Login=ausr and Password is null;   
  if existsCNt =1   
  then   
    select USERSID into ausersid from users where Login=ausr and Password is null;   
    select  mtz.newid() into aID from sys.dual;   
       if asysid is null then   
        insert into the_session(the_sessionid,lastaccess,usersid,closed,startAt)   
        values(aid,sysdate,ausersid,0,sysdate);   
       else   
        insert into the_session(instanceid,the_sessionid,lastaccess,usersid,closed,startAt)   
        values(asysid,aid,sysdate,ausersid,0,sysdate);   
       end if;   
     athe_session:=aid;   
      
     SysLogid:=MTZ.NEWID(); 
     MTZSystem.SysLog_SAVE( aTheSession=>aid,aCURSESSION=>aid, aInstanceID=>asysid, aSysLogid=>SysLogid, aLogStructID =>ausr, 
     aVERB=>''LOGIN_SUCCESS'', aThe_Resource=>ausr,aLogInstanceID=>null); 
  else 
     SysLogid:=MTZ.NEWID(); 
     MTZSystem.SysLog_SAVE( aTheSession=>aid,aCURSESSION=>aid, aInstanceID=>asysid, aSysLogid=>SysLogid, aLogStructID =>ausr, 
     aVERB=>''LOGIN_FAILED'', aThe_Resource=>ausr,aLogInstanceID=>null); 
  End if;   
else   
   
  select count(*) into existsCnt from users where Login=ausr and Password =aPWD;   
  if existsCNt =1   
  then   
   select USERSID into ausersid from users where Login=ausr and Password =aPWD;   
   select  mtz.newid() into aID from sys.dual;   
       if asysid is null then   
        insert into the_session(the_sessionid,lastaccess,usersid,closed,startAt)   
        values(aid,sysdate,ausersid,0,sysdate);   
       else   
        insert into the_session(instanceid,the_sessionid,lastaccess,usersid,closed,startAt)   
        values(asysid,aid,sysdate,ausersid,0,sysdate);   
       end if;   
     athe_session:=aid;   
      
     SysLogid:=MTZ.NEWID(); 
     MTZSystem.SysLog_SAVE( aTheSession=>aid,aCURSESSION=>aid, aInstanceID=>asysid, aSysLogid=>SysLogid, aLogStructID =>ausr, 
     aVERB=>''LOGIN_SUCCESS'', aThe_Resource=>ausr,aLogInstanceID=>null);  
      
  else   
    select count(*) into existsCnt from users where DomaiName=ausr and aPWD=''INTEGRATED'';   
    if existsCNt =1   
    then   
     select USERSID into ausersid from users where DomaiName =ausr ;   
     select  mtz.newid() into aID from sys.dual;   
       if asysid is null then   
        insert into the_session(the_sessionid,lastaccess,usersid,closed,startAt)   
        values(aid,sysdate,ausersid,0,sysdate);   
   
       else   
        insert into the_session(instanceid,the_sessionid,lastaccess,usersid,closed,startAt)   
        values(asysid,aid,sysdate,ausersid,0,sysdate);   
       end if;   
     athe_session:=aid;   
      
     SysLogid:=MTZ.NEWID(); 
     MTZSystem.SysLog_SAVE( aTheSession=>aid,aCURSESSION=>aid, aInstanceID=>asysid, aSysLogid=>SysLogid, aLogStructID =>ausr, 
     aVERB=>''LOGIN_SUCCESS'', aThe_Resource=>ausr,aLogInstanceID=>null); 
    else 
     SysLogid:=MTZ.NEWID(); 
     MTZSystem.SysLog_SAVE( aTheSession=>aid,aCURSESSION=>aid, aInstanceID=>asysid, aSysLogid=>SysLogid, aLogStructID =>ausr, 
     aVERB=>''LOGIN_FAILED'', aThe_Resource=>ausr,aLogInstanceID=>null); 
    End if;   
  end if;   
end if; -- password is null   
end;   
  ','Login','Login');

$$


insert into `GENMANUALCODE`( GENMANUALCODEid 
,ParentStructRowID,ChangeStamp,Code,the_Alias,Name) values( G2B('{85994822-DB32-44B9-B94F-8C6666DFFAB7}'),G2B('{C10CAD25-95ED-4518-9177-E29824F01E47}'),str_to_date('2012-01-20 14:40:23','%Y-%m-%d %H:%i:%s'),'create or replace function NEWID return varchar2 as
  Result varchar2(40);
  lguid raw(128);
  sTempString varchar2(40);
begin
  
  
  
  select sys_guid() into lguid from dual;
  
  sTempString:=to_char(lguid);
 
  Result:=''{'' || 
              Substr(sTempString, 1, 8) 
              || ''-'' ||
              Substr(sTempString, 9, 4) 
              || ''-'' ||
              Substr(sTempString, 13, 4) 
              || ''-'' ||
              Substr(sTempString, 17, 4) 
              || ''-'' ||
              Substr(sTempString, 21, 12) 
              || ''}'';
  return(Result);
end NEWID;','NEWID','NEWID');

$$


