insert into `GENMANUALCODE`( GENMANUALCODEid 
,ParentStructRowID,ChangeStamp,Code,the_Alias,Name) values( G2B('{B9CC7956-D7E2-4694-8EE8-DE68692E4D18}'),G2B('{C10CAD25-95ED-4518-9177-E29824F01E47}'),str_to_date('2012-01-20 14:40:23','%Y-%m-%d %H:%i:%s'),'create or replace procedure AutoCloseSession
 
 as  
 
asid char(38); 
begin 
declare cursor closer is 
select the_sessionid id from the_session where lastaccess < (sysdate()-0.008) and closed =0; 
closer_rec  closer%ROWTYPE; 
begin 
 --open closer; 
 for closer_rec in closer loop 
   Logout (closer_rec.id); 
 end loop; 
--close closer; 
end; 
end; 
/
declare
num_new_job_no number;
begin
select JOB into num_new_job_no from USER_JOBS where What=''begin MTZ.AutoCloseSession; end;'';
DBMS_JOB.REMOVE(num_new_job_no);
commit;
end;
/
declare
num_new_job_no number;
begin
sys.dbms_job.submit(job => num_new_job_no,
what => ''begin MTZ.AutoCloseSession; end;'',
next_date => sysdate + (1/1000),
interval => ''sysdate+30/1440'');
commit;
exception
when others then
dbms_output.put_line(sqlcode||sqlerrm);
end;
/
create or replace procedure AdminUnlockAll
 
 as  
 
begin 
update instance set LockUserID = null, LockSessionID=null  ;
end; 
/','JOB_FIX','AutoCloseSession-job-AdminUnlockAll');

$$


