insert into `SCRIPT`( SCRIPTid 
,ParentStructRowID,ChangeStamp,Code,Target) values( G2B('{10DB8C2F-AEB3-490D-871C-7444ACF38B24}'),G2B('{8D492A94-7078-4B7D-9847-AEFC27B4855D}'),str_to_date('2012-01-20 14:40:23','%Y-%m-%d %H:%i:%s'),'declare @parent varchar(255)
declare @prev varchar(255)

declare @tmpID  uniqueidentifier
declare @tmpRowID  uniqueidentifier

declare @s nvarchar(4000)

 -- checking session  --
if not exists( select 1 from the_session where the_sessionid=@cursession and closed=0 )
  begin
    raiserror(''Session expired'',16,1)
    if @@trancount>0 rollback tran
    return
  end

set @parent =@the_table
set @tmpID = @ROWID

again:

set @prev = @parent
set @parent = null
select @parent =value from sysoptions where optiontype = ''parent'' and  name=@prev

--print @parent

if @parent is null
begin
    set @s = N''select @root=InstanceID from '' + @prev + N'' where '' +@prev + N''id=@id''
--    print @s
    exec sp_executesql @s,N''@root uniqueidentifier out,@id uniqueidentifier'',@tmpRowID out,@tmpid
   set @InstanceID=@tmpRowID	    	
end
else
begin
    set @s = N''select @parent=ParentStructRowID from '' + @prev+ N'' where '' +@prev + N''id=@id''
--    print @s
    exec sp_executesql @s,N''@parent uniqueidentifier out,@id uniqueidentifier'',@tmpRowID out,@tmpid
    set @tmpID = @tmpROWID
    goto again
end
',G2B('{0C652C58-A952-4E8F-8CB0-D266431CD24B}'));

$$


