 begin
    declare @n nvarchar(4000)
    declare dl cursor for 
    select N''update ''+ value+'' set LockSessionID =null where LockSessionID=@cursession'' from sysoptions where optiontype=''MAP'' and Value not like ''V[_]%''	
    open dl
    fetch next from dl into @n
    while @@fetch_status >=0
    begin
	exec sp_executesql @n,N''@CURSESSION uniqueidentifier'',@CURSESSION
	fetch next from dl into @n
    end
    close dl
    deallocate dl
    update INSTANCE set LockSessionID =null where LockSessionID=@cursession    
    update the_session set closed=1,closedAt=getdate(), changeStamp=getdate() where the_sessionid=@cursession
 End

',G2B('{0C652C58-A952-4E8F-8CB0-D266431CD24B}'));

